import './App.css';

import Rectangle from './assets/Rectangle.png'; 
import facebook from './assets/facebook.png';
import twitter from './assets/twitter.png';
import linkdin from './assets/linkdin.png';
import Header from './components/Header';
import Main from './components/Main'; 
import Works from './components/Works';
import Featurs from './components/Featurs';
import Team from './components/Team';
import Brand from './components/Brand';
import Download from './components/Download';



function App() {
  return (
    <div className='parent'>

      <div
      className="h-screen bg-cover bg-center"
      style={{ backgroundImage: `url(${Rectangle})` }}
     >
      <div>
            <Header />
         <div className='border border-gray-500 width-[100px] mb-[149px]'></div>

             <Main />
      </div>
      </div>

       <Featurs/>


         <Works/>

          <Team/>

          <Brand/>




      <footer>
        <div style={{ backgroundImage: `url(${Rectangle})` }} className='h-[200px] w-full'>
           <div className='flex text-white lg:justify-evenly lg:items-center pt-[50px] m-4 gap-10'>
              <div>
               <p>Location</p>
               <p>3481 Melrose Place</p>
               <p>Beverly Hills, CA 90210</p>
             </div>

             <div>
               <p>Share with Love</p>
                <div className='flex gap-2'>
                  <img src={facebook} alt=''/>
                   <img src={twitter} alt=''/>
                    <img src={linkdin} alt=''/>
                </div>
             </div>

             <div className=''>
               <p>About ActiveBox <br/>
               eget quam. Donec ullamcorper nulla non metus <br/>
               eget quam. Donec ullamcorper nulla non metus</p>
             </div>
           </div>
        </div>

        <div  className='text-center h-[100px] w-full'>
          <p className='text-[13px] m-5'>copyright Â© 2015 ActiveBox. All Rights Reserved</p>
          <p className='lg:text-[18px]'>Made with Khushi pawar</p>
        </div>
      </footer>
 </div> 




 );
}

export default App;
